<script>
  const DauMixin = subclass =>
  
    class DauInterface extends subclass {
        constructor() {
          super();
          this._iocInject('DauModel');
        }

        _getDauGeometry() {
          return this.DauModel.getGeometry();
        }


        _getDauData(id) {
          return this.EtoZOneModel.getDauData(id);
        }
    }
</script>
